import axios from "axios";

const COURSE_API_BASE_URL = "http://localhost:8080/course";

class CourseService {
  getCourses() {
    return axios.get(COURSE_API_BASE_URL);
  }

  getCourseById(id) {
    return axios.get(COURSE_API_BASE_URL + "/" + id);
  }
}

export default new CourseService();
